# creatingFlaskApp
from flask import Flask,render_template,redirect



app = Flask(__name__)

class Music:
    def __init__(self,a,i,t,img):
        self.artist=a
        self.instrument=i
        self.type=t
        self.img = img
    
m=Music("Bieber","Guitar","Pop","data:image/jpeg;base64,")
m1=Music("Martin Garrix","Dj","EDM","data:image/jpeg;base64,")
m2=Music("A.Christopher","Piano",'Acoustic',"data:image/jpeg;base64,")

list_music = [m, m1, m2]
@app.route("/music")
def music():
    return render_template("music.html" , musics = list_music)


@app.route("/")
def index():
    return render_template("movie.html")








