@app.route("/Hello/<name>")
def index_3(name):

    user = {
        "huy" : {
            "name" : "Nguyen Quang huy",
            "age" : 29
        },
        "don" : {
            "name" : "Pham Quy Don",
            "age" : 23
        }
    }
    text = ""
    if name not in user:
        return "user not found"

    for info in user[name]:
        text += info
        text += ":"
        text += str(user[name][info])
        text += "</br>"
    return text
    
    
        

